import React from 'react'
import MySkills from '../Components/MySkills'
import AboutMe from '../Components/AboutMe'
import logo from '../images/logo.png'
import styled from 'styled-components';
import {Carousel} from '3d-react-carousal';

let slides = [
    <img  src="" alt="Js" />,
    <img  src="" alt="React Js" />,
    <img  src="" alt="Java" />,
    <img  src="" alt="Web dev" />,
    <img src="" alt="5" />   
];

function AboutPage() {
    return (
        <div className="AboutPage">
            <AboutMe />
            <div className="skillsContainer">
                <MySkills skill={'Javascript'} progress={'60%'} width={'60%'}  />
                <MySkills skill={'React Js'} src={logo} progress={'50%'} width={'50%'} />
                <MySkills skill={'Java'} progress={'70%'} width={'70%'} />
                <MySkills skill={'PHP'} progress={'50%'} width={'50%'} />
                <MySkills skill={'UI/Ux Design'} progress={'75%'} width={'75%'} />
            </div>
            <CarouselStyled>
            <div>
            <Carousel className="carousel" slides={slides} autoplay={false} interval={1000}/>
            </div>
            </CarouselStyled>
    </div>
    )
}
const CarouselStyled = styled.header`
.carousel{
    width: 50%;
    height: 100vh;
    align-items:right;
}
`;
export default AboutPage;
